import React from "react";
import Project from "./Project";
import gba from "./gameboyzarcade.png";
const projs = [];

function Projects() {
  return (
    <div>
      <br />
      <h4>Projects</h4>
      <a
        className="link"
        href="https://gameboyzarcade.netlify.app/"
        target="_blank"
      >
        <img src={gba} className="thumbnail"></img>
        <div>GameBoysArcade</div>
      </a>
      {/* list of projects
      {projs.map((p) => (
        <Project project={p} />
      ))} */}
    </div>
  );
}

export default Projects;
